import FirstPage from "../SVG/FirstPage";
import LastPage from "../SVG/LastPage";
import PushLeft from "../SVG/PushLeft";
import PushRight from "../SVG/PushRight";

export const TableButtons = ({
    gotoPage,
    canPreviousPage,
    canNextPage,
    previousPage,
    nextPage,
    pageCount,
    handlePageChange,
  }) => {
    return (
      <div>
        <button
          onClick={() => {
            handlePageChange();
            gotoPage(0);
            handlePageChange();
          }}
          disabled={!canPreviousPage}
        >
          <FirstPage />
        </button>
        <button
          onClick={() => {
            handlePageChange();
            previousPage();
            handlePageChange();
          }}
          disabled={!canPreviousPage}
        >
          <PushLeft />
        </button>
        <button
          onClick={() => {
            handlePageChange();
            nextPage();
            handlePageChange();
          }}
          disabled={!canNextPage}
        >
          <PushRight />
        </button>
        <button
          onClick={() => {
            handlePageChange();
            gotoPage(pageCount - 1);
            handlePageChange();
            
          }}
          disabled={!canNextPage}
        >
          <LastPage />
        </button>
      </div>
    );
  };
